const char *mcc_to_str(const char * const  mcc_s) {
    const int mcc = atoi(mcc_s);

    for (uint_fast32_t i = 0; mcc_list[i].countryCode; i++) {
        if (mcc_list[i].mcc == mcc) {
            return mcc_list[i].GSM_MCC_FIELD;
        }
    }

    return GSM_NOT_FOUND;
}


const char *mnc_to_str(const char * const mcc_s, const char * const mnc_s) {
    const int mcc = atoi(mcc_s);
    const int mnc = atoi(mnc_s);

    for (uint_fast32_t i = 0; mnc_list[i].operator; i++) {
        if (mnc_list[i].mcc != mcc) continue;
        for (; mnc_list[i].mcc == mcc; i++)
        {
            if (mnc_list[i].mnc == mnc) return mnc_list[i].GSM_MNC_FIELD;
        }
        break;
    }

    return GSM_NOT_FOUND;
}
